// Utilitaires pour les documents réels
export const realDocumentUtils = {
  getDocumentsByCategory: (category: string): DocumentAttachment[] => {
    return realDocumentsByCategory[category] || [];
  },
  
  getDocumentsByFolder: (folder: string): DocumentAttachment[] => {
    return realDocumentsByFolder[folder] || [];
  },
  
  searchDocuments: (query: string): DocumentAttachment[] => {
    const searchTerm = query.toLowerCase();
    return realDocuments.filter(doc => 
      doc.name.toLowerCase().includes(searchTerm) ||
      doc.folder.toLowerCase().includes(searchTerm)
    );
  },
  
  formatFileSize: (bytes: number): string => {
    if (bytes === 0) return '0 B';
    const k = 1024;
    const sizes = ['B', 'KB', 'MB', 'GB'];
    const i = Math.floor(Math.log(bytes) / Math.log(k));
    return parseFloat((bytes / Math.pow(k, i)).toFixed(1)) + ' ' + sizes[i];
  },
  
  formatLastModified: (dateString: string): string => {
    const date = new Date(dateString);
    const now = new Date();
    const diffTime = Math.abs(now.getTime() - date.getTime());
    const diffDays = Math.ceil(diffTime / (1000 * 60 * 60 * 24));
    
    if (diffDays === 1) return 'Hier';
    if (diffDays < 7) return `Il y a ${diffDays} jours`;
    if (diffDays < 30) return `Il y a ${Math.ceil(diffDays / 7)} semaine${Math.ceil(diffDays / 7) > 1 ? 's' : ''}`;
    if (diffDays < 365) return `Il y a ${Math.ceil(diffDays / 30)} mois`;
    return `Il y a ${Math.ceil(diffDays / 365)} an${Math.ceil(diffDays / 365) > 1 ? 's' : ''}`;
  },
  
  downloadDocument: (document: DocumentAttachment): void => {
    // Créer un lien de téléchargement
    const link = document.createElement('a');
    link.href = document.src;
    link.download = document.name;
    link.target = '_blank';
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  },
  
  getFileType: (document: DocumentAttachment): string => {
    return document.type;
  }
};
